import React from 'react';
import Head from 'next/head';
import {Provider} from 'react-redux'; 
const App = ({Component}) => {
    return(
        <>
            <Provider>
                <Head>
                    
                </Head>
                <Component />
            </Provider> 
        </>
    )
}

export default App;
